};

const sortedPosts = sortPosts(posts);

const PostList = (props) => {
  return (
    <ul>
      {sortedPosts.map((post) => {
        <PostItem
          key={post.id}
          modifiedDate={post.modifiedDate}
          userName={post.userName}
          title={post.title}
        />;
      })}
    </ul>
  );
};

export default PostList;
